(1, 'sms', 'dn', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>Hej, &nbsp;&shy;&nbsp;</p>\n<p>Jeg er blevet medlem af det sociale sikkerhedsnetv&aelig;rk NaboSupport. Sammen kan vi opn&aring; mere tryghed i nabolaget. L&aelig;s mere p&aring; deres hjemmeside www.nabosupport.dk eller download APP\'en og bliv medlem allerede idag.&nbsp;</p>\n<p>iOS: https://apple.co/2Ng8n9e&nbsp;</p>\n<p>Android: http://bit.ly/363xrcd&nbsp;</p>\n<p>Dbh Br NaboSupport</p>\n</body>\n</html>', 1, '2018-10-16 06:08:37', '2018-10-16 06:08:37'),
(2, 'sms', 'en', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>Hi,</p>\n<p>I just joined the social security network NaboSupport, but together we can gain more from this community. Check it out and join on&nbsp;www.nabosupport.dk&nbsp;or download their APP today. &nbsp; &nbsp;</p>\n<p>iOS: <a href=\"https://apple.co/2Ng8n9e\">https://apple.co/2Ng8n9e </a></p>\n<p>Android: <a href=\"http://bit.ly/363xrcd\">http://bit.ly/363xrcd</a></p>\n</body>\n</html>', 1, '2018-10-16 06:08:37', '2018-10-16 06:08:37'),
(3, 'invite', 'dn', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran; font-size: 18px;\">Hej,</span></div>\n<div style=\"color: #500050; text-align: left;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Jeg vil gerne invitere dig med i det sociale netv&aelig;rk NaboSupport.</span></span></div>\n<div style=\"color: #500050; text-align: left;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Jeg er allerede blevet en del af NaboSupport\'s store netv&aelig;rk af naboer og alarmsystemer. NaboSupport er en ny og moderne overv&aring;gningsplatform, som samler opm&aelig;rksomme naboer i n&aelig;romr&aring;det i et f&aelig;lles netv&aelig;rk mod tyveri.&nbsp;</span></span></div>\n<div style=\"color: #500050; text-align: left;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Hvis det lyder interessant, kan du downloade APP\'en via nedenst&aring;ende links og l&aelig;se mere p&aring; NaboSupports hjemmeside.</span></span></div>\n<div style=\"color: #500050; text-align: left;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Download APP i iOS</span></span></div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Download APP i Android</span></span></div>\n<div style=\"color: #500050; text-align: left;\">&nbsp;</div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Hvis du har sp&oslash;rgsm&aring;l til NaboSupport kan du kontakte dem p&aring; info@nabosupport.dk&nbsp;</span></span></div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">&nbsp;</span></span></div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">De bedste hilsner</span></span></div>\n<div style=\"color: #500050; text-align: left;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">&lt;&lt;userName&gt;&gt;</span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #00afcd;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></div>\n<div style=\"color: #500050;\">\n<div><hr /><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"color: #00afcd;\"><br /></span><span style=\"color: #c0c0c0;\"><a style=\"caret-color: #500050;\" href=\"http://www.NaboSupport.dk\">NaboSupport ApS</a>,&nbsp;Virum Vandvej 38,&nbsp;2830 Virum,&nbsp;CVR: 39 10 35 91</span><br /><span style=\"color: #c0c0c0;\">TEL: +45 2032 9192, Email:</span><span style=\"color: #c0c0c0;\">&nbsp;</span><span style=\"color: #3366ff;\"><a style=\"color: #3366ff;\" href=\"mailto:info@nabosupport.dk\" target=\"_blank\" rel=\"noopener\">info@nabosupport.dk</a></span></div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n</div>\n</body>\n</html>', 1, '2018-10-16 07:48:20', '2018-10-16 07:48:20'),
(4, 'invite', 'en', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran; font-size: 18px;\">Hi,</span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\">\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">I would like to invite you to join the social network NaboSupport.</span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">I have already become part of NaboSupport\'s large network of neighbors and alarm systems. NaboSupport is a new and modern surveillance platform that brings together close-knit neighbors in a common network against theft.</span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">If this sounds interesting, you can download the APP via the links below and read more on NaboSupport\'s website.</span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Download APP in iOS</span></span></div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">Download APP on Android</span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">If you have any questions about NaboSupport, you can contact them at <a href=\"mailto:info@nabosupport.dk\">info@nabosupport.dk</a></span></span></div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">The best greetings</span></span></div>\n<div style=\"color: #500050;\"><span style=\"color: #606060; font-family: Catamaran;\"><span style=\"font-size: 18px;\">&lt;&lt; userName &gt;&gt;</span></span></div>\n</div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\">&nbsp;</div>\n<div style=\"color: #500050;\"><span style=\"color: #00afcd;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></div>\n<div style=\"color: #500050;\">\n<div><hr /><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"color: #00afcd;\"><br /></span><span style=\"color: #c0c0c0;\"><a style=\"caret-color: #500050;\" href=\"http://www.NaboSupport.dk\">NaboSupport ApS</a>,&nbsp;Virum Vandvej 38,&nbsp;2830 Virum,&nbsp;CVR: 39 10 35 91</span><br /><span style=\"color: #c0c0c0;\">TEL: +45 2032 9192, Email:</span><span style=\"color: #c0c0c0;\">&nbsp;</span><span style=\"color: #3366ff;\"><a style=\"color: #3366ff;\" href=\"mailto:info@nabosupport.dk\" target=\"_blank\" rel=\"noopener\">info@nabosupport.dk</a></span></div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n</div>\n</body>\n</html>', 1, '2018-10-16 07:48:20', '2018-10-16 07:48:20');
INSERT INTO `faq` (`id`, `lang`, `content`, `status`, `date`) VALUES
(13, 'en', '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<h2><span id=\"docs-internal-guid-c1f305b9-7fff-365f-ac05-da16eac8d93d\" style=\"font-weight: normal;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">S&oslash;ger du svar p&aring; noget omkring vores produkt, kan du m&aring;ske finde svar her. Du er ogs&aring; velkommen til at kontakte os p&aring; Nabosupport.dk.</span></span></h2>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvad betyder de forskellige farvet ikoner?</span></li>\n</ul>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #0000ff; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Bl&aring;</span><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> = Nabosupporter</span></p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #ff0000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">R&oslash;d</span><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> = Alarm - Dette kan f.eks. v&aelig;re et indbrud.</span></p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: #ff9900; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Orange</span><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> = Mist&aelig;nkelig adf&aelig;rd - Det kan f.eks. v&aelig;re en mist&aelig;nkelig bil som k&oslash;rer rundt i omr&aring;det. Ved at trykke p&aring; ikonet kan du bl.a. bekr&aelig;fte at du har set det samme eller at du allerede har informeret politiet.</span></p>\n<p><span id=\"docs-internal-guid-d77fa592-7fff-bfc0-a8e7-5c2ef3f5304f\">&nbsp;</span></p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Min placering p&aring; kortet vises ikke.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Er din adresse ikke markeret p&aring; kortet, kan der v&aelig;re g&aring;et noget galt med din konto. Kontakt Nabosupport.dk og vi vil hj&aelig;lpe dig i gang.</span></p>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Der er ingen nabosupportere i omr&aring;det.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvis der endnu ikke er andre nabosupportere i dit omr&aring;de, skal du tage fat i dine n&aelig;rmeste naboer. Vi st&aring;r st&aelig;rkere n&aring;r vi er flere i vores netv&aelig;rk.</span></p>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvordan &aelig;ndrer jeg min mail?</span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Inde under dine kontoindstillinger i app&rsquo;en kan du &aelig;ndre dine informationer.</span></p>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvordan opretter jeg min alarm?</span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">For at f&aring; oprettet din alarm til Nabosupport, skal du v&aelig;re abonnent hos os. Efterf&oslash;lgende skal du indtaste dit Alarm ID eller din alarms telefonnummer p&aring; din adresse under menupunktet &ldquo;Min alarm&rdquo;</span></p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Nabosupport skal ogs&aring; oprettes som kontaktperson i dit alarmsystem med f&oslash;lgende telefonnummer: +45 2580 7338</span></p>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mit alarmselskab er der ikke.</span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; margin-left: 36pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvis vi endnu ikke har tilf&oslash;jet din alarmselskab hos Nabosupport, kan du kontakte os p&aring; Nabosupport.dk. Vi vil efterf&oslash;lgende s&oslash;rge for at ogs&aring; din alarm kan forbindes til Nabosupport.</span></p>\n<p>&nbsp;</p>\n<ul>\n<li dir=\"ltr\" style=\"line-height: 1.2;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Jeg modtager ikke en notifikation n&aring;r min alarm g&aring;r i gang. </span></li>\n</ul>\n<p>&nbsp;</p>\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 6pt; margin-bottom: 6pt; margin-left: 36pt; padding: 0pt 0pt 7.5pt;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hvis ikke du modtager en notifikation ved alarm, er dit Alarm ID muligvis ikke v&aelig;re indtastet korrekt.</span></p>\n</body>\n</html>', 1, '2018-10-13 09:16:26');
